// src/Title.js

import React from 'react'
import './Title.css';

function Title() {
  return (
    <div classname="Title">
        <h1>Mood Chart</h1>
        <div className="Title-Subtitle">How do you feel today?</div>          
    </div>
  )
}

export default Title
